import React from "react";
import { NavLink } from "react-router-dom";

const HeaderComp = () => {
  return (
    <header>
      <nav className="navbar">
        <NavLink to="/" className="nav-brand">
          <img src="/logo.svg" alt="" />
        </NavLink>
      </nav>
    </header>
  );
};

export default HeaderComp;
